import React from 'react';
import { useNavigate } from 'react-router-dom';

const Incidents = () => {
  const navigate = useNavigate();

  // Replace with your actual data
  const incidents = [
    { id: 1, src: '1.jpg', alt: 'Forest in fog' },
{ id: 2, src: '2.jpg', alt: 'Stacked logs' },
{ id: 3, src: '3.jpg', alt: 'Blue wooden texture' },// Incidents.js

    // ... your incidents data
  ];

  return (
    <div className="flex-grow p-8">
      <button onClick={() => navigate('/dashboard')} className="mb-4 bg-blue-500 text-white py-2 px-4 rounded hover:bg-blue-700 transition duration-300">
        Back to Dashboard
      </button>
      <div className="grid grid-cols-2 md:grid-cols-3 gap-4">
        {incidents.map((incident) => (
          <div key={incident.id} className="aspect-w-1 aspect-h-1">
            <img src={incident.src} alt={incident.alt} className="object-cover rounded-lg" />
          </div>
        ))}
      </div>
    </div>
  );
};

export default Incidents;
